import React from "react";
import {Chart} from 'primereact/chart';
import DonutChart from 'react-donut-chart';

export default function Pie1() {

  const data = {
    labels: ['A','B','C'],
    datasets: [
        {
            data: [300, 50, 100],
            backgroundColor: [
                "#FF6384",
                "#36A2EB",
                "#FFCE56"
            ],
            hoverBackgroundColor: [
                "#FF6384",
                "#36A2EB",
                "#FFCE56"
            ]
        }]
    };
    return (
      <div>
      <Chart type="pie" data={data} />
  </div>
    );
  }
